import React, {SetStateAction, useEffect, useState} from "react";
import cn from "classnames";


interface Props {
    text: string,
    className : string,
    setType : React.Dispatch<SetStateAction<string>>,
    type : string
}
export default function HeadButton({text, className, setType, type} : Props){
    const [checked, setChecked] = useState(false);
    const handleChange = (ev: React.MouseEvent<HTMLButtonElement>) => {
        setType(type);
        setChecked(true);
    };

    useEffect(() => {

    }, [type]);
    return (
        <div className='head_button_group'>
            <HeadButton type={'01'} text={'마이체크업'} setType={setType} className='header_button'/>
            <HeadButton type={'02'} text={'벨류맵'} setType={setType} className='header_button'/>
        </div>
    )
}
